import React  from 'react';
import Nav from 'react-bootstrap/Nav';
import Link from 'next/link';
import SLink from './StyledLink';

function SiteNav(props) {

    return (
            <nav>
                <ul>
                <SLink url="/" name="Home" />
                <SLink url="/skills" name="Skills" />
                </ul>
            </nav>
    )
}

export default SiteNav;
